mapper.delete:

delete from cal_service_multi


    and service_order = #{service_order,jdbcType=CHAR}


    and service_request_source = #{service_request_source,jdbcType=CHAR}


    and call_datetime = #{call_datetime,jdbcType=TIMESTAMP}


    and call_person = #{call_person,jdbcType=NVARCHAR}


    and call_tel = #{call_tel,jdbcType=NVARCHAR}


    and call_content = #{call_content,jdbcType=NVARCHAR}


    and call_remark = #{call_remark,jdbcType=NVARCHAR}


    and enable_flag = #{enable_flag,jdbcType=CHAR}


    and create_user = #{create_user,jdbcType=NVARCHAR}


    and create_timestamp = #{create_timestamp,jdbcType=TIMESTAMP}


    and last_update_user = #{last_update_user,jdbcType=NVARCHAR}


    and last_update_timestamp = #{last_update_timestamp,jdbcType=TIMESTAMP}


    and last_update_remark = #{last_update_remark,jdbcType=NVARCHAR}

mapper.select:

select id, service_order, service_request_source, call_datetime, call_person, call_tel, 
call_content, call_remark, enable_flag, create_user, create_timestamp, last_update_user, 
last_update_timestamp, last_update_remark
from cal_service_multi


    and service_order = #{service_order,jdbcType=CHAR}


    and service_request_source = #{service_request_source,jdbcType=CHAR}


    and call_datetime = #{call_datetime,jdbcType=TIMESTAMP}


    and call_person = #{call_person,jdbcType=NVARCHAR}


    and call_tel = #{call_tel,jdbcType=NVARCHAR}


    and call_content = #{call_content,jdbcType=NVARCHAR}


    and call_remark = #{call_remark,jdbcType=NVARCHAR}


    and enable_flag = #{enable_flag,jdbcType=CHAR}


    and create_user = #{create_user,jdbcType=NVARCHAR}


    and create_timestamp = #{create_timestamp,jdbcType=TIMESTAMP}


    and last_update_user = #{last_update_user,jdbcType=NVARCHAR}


    and last_update_timestamp = #{last_update_timestamp,jdbcType=TIMESTAMP}


    and last_update_remark = #{last_update_remark,jdbcType=NVARCHAR}
